import React from 'react';
import { withRouter } from 'react-router-dom';
import { iconMapping } from "../utils/iconsMapping.js";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

import "./header.css";

const Header = props => {
    if (props.location.pathname === "/dashboard" || props.location.pathname === "/modules") return null;
    return (
        <div className="headerWrapper">
            <span className="links">
                <span>About</span> <span>|</span>
                <span> Services</span> 
            </span>
            <span className="right">
                <span className="social">
                    Follow us: 
                    <FontAwesomeIcon color="white" icon={iconMapping["facebook"]} data-tip data-for='Exams' size="1x" />
                </span>
                <span> | </span>
                <span className="contactUs">
                    kjj
                </span>
            </span>
        </div>
    );
};

export default withRouter(Header);
